package javaAssigments;

public class SwapNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=5;
		int b=10;
		int temp;
		temp= a;
		a=b;
		b=temp;
		System.out.println("a  value is = "  + a );
		System .out.println("b value is =" +b);
		

	}

}
